import classes from './BookRooms.module.css'
function BookRooms(){
    return(
        <div className={classes.bookingSection}>
           <label className={classes.bookingLabels} htmlFor=''>Name</label>
           <input type='text'></input>
           <Button />
        </div>
    )
}
export  default BookRooms
